var Baby = function(gestation, gender, dob, tob) {
// Baby Function v1.0
// Date 14 August 2014
//
// INPUTS
// - gestation = 37+5
// - gender = m/f
// - dob = date of birth d/M/yyyy
// - tob = time of birth 00:00
//
// OUTPUTS
// - gestationweek()
// - gestationday()
// - term() = term / preterm
// - spandays() = number of days old

	this.dob = dob;
	this.dobdate = new Date.parseExact(this.dob, "d/M/yyyy");
	this.dobdatem = moment(dob, "DD/MM/YYYY");
	this.gestation = gestation;
	this.gender = gender;
	this.tob = tob;

	// Set defaults if not set
	if(typeof this.tob === "undefined") {this.tob = "00:00"}

	this.gestationweek = function() {
		if(this.gestation==""){return "Gestation not defined";}
		var gestationsplit = this.gestation.split("+");
		if(isNaN(gestationsplit[1]) == true) { gestationsplit[1] = "0";}
		if(gestationsplit[1] == ""	) { gestationsplit[1] = "0";}
		return gestationsplit[0];
	}

	this.gestationday = function() {
		if(this.gestation==""){return "Gestation not defined";}
		var gestationsplit = this.gestation.split("+");
		if(isNaN(gestationsplit[1]) == true) { gestationsplit[1] = "0";}
		if(gestationsplit[1] == ""	) { gestationsplit[1] = "0";}
		return gestationsplit[1];
	}

	this.term = function() {
		if (this.gestationweek() >= 37) { return "term"; }
		else if (this.gestationweek() >= 20 && this.gestationweek() < 37) { return "preterm"; }
		else {return "";}
	}


} // end of baby function

var Babyage = function (Baby, datetodayinput) {

// Baby age v1.0
//
// INPUTS
// Baby = Object set up previously
// datetodayinput = Date for calculation ("dd/mm/yy")

	this.datetodayinput = datetodayinput;
	this.dobdatem = moment(Baby.dobdate.toString('dd/MM/yyyy'), "DD/MM/YYYY");
	this.datetodaym = moment(datetodayinput, "DD/MM/YYYY");

	this.spandays = function() {
		if(typeof this.datetodayinput === "undefined") {
			console.log("Undefined date"); this.datetoday = new Date();
		}
		else {
			this.datetoday = Date.parseExact(this.datetodayinput, "dd/MM/yyyy");
		}

		var agespecific = new TimeSpan(this.datetoday - Baby.dobdate);
		if (agespecific.days < 0) {
			return "Please check dates (negative age!)";
		}
		else {
			return agespecific.days;
		}
	}

	this.day = function() {
		if (typeof this.spandays() == "string") {
			return this.spandays();
		}
		else {
			return this.spandays()+1;
		}
		
	}

	this.exactAgeHuman = function () {
		if (moment(this.datetodaym).isBefore(this.dobdatem) == true) {
			return "Please check dates (negative age!)";
		}
		else
		{
			return moment.preciseDiff(this.dobdatem, this.datetodaym);
		}
	}

	this.ga = function () {
		// Inputs:
		// days old = this.spandays()
		// Baby.gestationweek() / gestationday()

		// How many pma days old now
			var babypmadays = (Baby.gestationweek()*7) + Number(Baby.gestationday());
			var pmadaysnow = Number(babypmadays) + Number(this.spandays());

		// Convert back to weeks+days
			pmaweeks = Math.floor(pmadaysnow/7);
			pmadays = pmadaysnow - (pmaweeks*7);

			this.pmaweeks = pmaweeks;
			this.pmadays = pmadays;
			this.pmadaysnow = pmadaysnow;
		return pmaweeks + "+" + pmadays;
	}

	this.cga = function () {
		// Inputs:
		// this.ga = current post menstrual age
		// Baby.gestationweek() / gestationday()

		// Call this.ga() to set up pma variables
		this.ga();

		// Is the baby born <37 weeks? --> needs correcting
			if (Baby.gestationweek() >= 37) {
				// If term, then simple calculation
				return this.exactAgeHuman();
			}
			else {
				if (this.pmaweeks < 40) {
					// <40 weeks --> CGA not appropriate yet
					return "Baby has not yet reached term."
				}
				else {
					if (moment(this.datetodaym).isBefore(this.dobdatem) == true) {
						return "Please check dates (negative age!)";
					}
					else {
						// return calculate corrected age now
						return moment.preciseDiff(this.duedatem(), this.datetodaym);
					}
				}
			}
	}

	this.duedatem = function () {
		// calculate number of days premature
		var fullgestation = 40*7;
		var babypremdays = fullgestation - (Baby.gestationweek()*7 + Number(Baby.gestationday()));

		// due date
		return moment(this.dobdatem).add(babypremdays, 'days');
	}

	this.yearsLMS = function () {
		return moment.preciseDiffLMS(this.duedatem(), this.datetodaym);
	}


}





