Number.prototype.toOrdinal = function() {
    var n = this % 100;
    var suffix = ['th', 'st', 'nd', 'rd', 'th'];
    var ord = n < 21 ? (Number(n.toString().slice(-1)) < 4 ? suffix[Number(n.toString().slice(-1))] : suffix[0]) : (Number(n.toString().slice(-1)) % 10 > 4 ? suffix[0] : suffix[Number(n.toString().slice(-1)) % 10]);
    return this + ord;
};

// Z-score calculations
var Z_MAX = 6;                    // Maximum z value
var ROUND_FLOAT = 6;              // Decimal places to round numbers
function poz(z) {
	var y, x, w;
	
	if (z == 0.0) {
		x = 0.0;
	} else {
		y = 0.5 * Math.abs(z);
		if (y > (Z_MAX * 0.5)) {
			x = 1.0;
		} else if (y < 1.0) {
			w = y * y;
			x = ((((((((0.000124818987 * w
					 - 0.001075204047) * w + 0.005198775019) * w
					 - 0.019198292004) * w + 0.059054035642) * w
					 - 0.151968751364) * w + 0.319152932694) * w
					 - 0.531923007300) * w + 0.797884560593) * y * 2.0;
		} else {
			y -= 2.0;
			x = (((((((((((((-0.000045255659 * y
						   + 0.000152529290) * y - 0.000019538132) * y
						   - 0.000676904986) * y + 0.001390604284) * y
						   - 0.000794620820) * y - 0.002034254874) * y
						   + 0.006549791214) * y - 0.010557625006) * y
						   + 0.011630447319) * y - 0.009279453341) * y
						   + 0.005353579108) * y - 0.002141268741) * y
						   + 0.000535310849) * y + 0.999936657524;
		}
	}
	return z > 0.0 ? ((x + 1.0) * 0.5) : ((1.0 - x) * 0.5);
}


// Convert a number to a growth centile range
var growth_centile_to_range = function(inputcentile) {

	// check for missing value
	if (isNaN(inputcentile) == true) {
		return "<span class=\"greytext\">Missing measurement</span>";
	}

	// set up array details with growth centiles
	var theArray = [0.4, 2, 9, 25, 50, 75, 91, 98, 99.6];
	var goal = inputcentile;
	var closest = null;
	var closestid= null;
	var nextclosest = null;
	var i = null;
	var outputcentiletext;

	// look for closest centile range
	$.each(theArray, function(i){
	  if (closest == null || Math.abs(this - goal) < Math.abs(closest - goal)) {
		closest = this;
		closestid = i;
	  }
	});

	if (inputcentile > closest)
	{
		nextclosest = theArray[closestid+1];
	}
	else if (inputcentile < closest)
	{
		nextclosest = theArray[closestid-1];
	}
	else if (inputcentile = closest)
	{
		nextclosest = closest;
	}
	// now clean up

	if (inputcentile >= 99.6)
	{
		outputcentiletext = ">99.6th centile";
	}
	else if (inputcentile <= 0.4)
	{
		outputcentiletext = "<0.4th centile";
	}
	else if (closest != null && nextclosest != null)
	{
		if (closest > nextclosest)
		{
			outputcentiletext = nextclosest.toOrdinal() + " - " + closest.toOrdinal() + " centile";
		}
		else if (nextclosest > closest)
		{
			outputcentiletext = closest.toOrdinal() + " - " + nextclosest.toOrdinal() + " centile";
		}
		else if (nextclosest = closest)
		{
			outputcentiletext = closest.toOrdinal() + " centile";
		}

	}
	else {
		outputcentiletext = "Error";
	}

	return outputcentiletext;

}

function NaNFix(input) {
	if (input == "" || typeof input == "undefined") {return " ";}
	else {return " (" + input + ")";}
}

